import './UserList.css'



const UserList = (props) => {

    const filterUsers = props.items.filter((user)=>{return user})

    return (
        <ul className="UsersList__">
            <li>Alan  (31 years old)</li>
            <li>Max  (34 years old)</li>
            <li>Julia  (28 years old)</li>
            {props.items.map((user)=>{
                return (
                    <li key={user.key}>{user.name}{user.age}</li>
                )
            })}
        </ul>
    )
}

export default UserList
